import Data from './Data'

  const[cont] = [ 

    {
      'num' : "1:",
      'sml' :"yes",
      'name' : "Presbo",
      'email' : 'presbo@columbia.edu',
    }

  ]

  const Cont = () => {
    return (
      <div> 
        {cont.map((num,sml,nam,email) => (
          <Data num = {num} sml = {sml} nam = {nam} email = {email}/>
        ))}
      </div>
    )
  } 

  export default Cont
